import React from 'react'
import Info from '../'

function familia(){
    return Info.map(dados => {
        return <li>
            Nome: {Info.nome} idade: {Info.idade} status: {Info.status}
        </li>
    })
}

export default ()=> 
<React.Fragment>
    <ul>
        {familia()}
    </ul>
</React.Fragment>
